import React from 'react'

const Home = () => {
  return (
    <div>
      <div class="container">
        <div class="typed-out">Hello world! I'm Pablo</div>
        <p>I'm a 18 years old web developer, and I help people</p>
      </div>
    </div>
  )
}

export default Home
